import video from "https://project-2-api.herokuapp.com/stream";
import image from "https://i.imgur.com/l2Xfgpl.jpg";

function Video() {
    return(
        <div className="video__container">
            <video width="320" height="240" className="video" poster={image} controls>
                <source src={video} type="video./mp4"/>
            </video>
        </div>
    );
}

export default Video;
